  \"2016-02-26T22:03:49.752588\",\n\t\"name\": \"prognostics-of-power-mosfet\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This paper demonstrates how to apply prognostics
  to power MOSFETs (metal oxide field effect transistor). The methodology uses thermal
  cycling to age devices and Gaussian process regression to perform prognostics. The
  approach is validated with experiments on 100V power MOSFETs. The failure mechanism
  for the stress conditions is determined to be die-attachment degradation. Change
  in ON-state resistance is used as a precursor of failure due to its dependence on
  junction temperature. The experimental data is augmented with a finite element analysis
  simulation that is based on a two-transistor model. The simulation assists in the
  interpretation of the degradation phenomena and SOA (safe operation area) change.\",\n\t\"license_title\":
